(1, 1, 1, 1, 1, 'news-1-1102-6998.jpg', '{\"p\":\"news-1-1102-6998.jpg\",\"w\":270,\"h\":200,\"m\":\"image\\/jpeg\"}', 'nike-gioi-thieu-giay-da-bong-bang-dan-doc-dao', 'nike-introduces-a-unique-taped-soccer-shoe', '&lt;p&gt;Frank Rudy was the first person to have the idea of ‚Äã‚Äãputting air cushioning in a shoe. His inspiration comes from the night set designs of spacecraft at NASA - where he works every day.&lt;/p&gt;\r\n\r\n&lt;p&gt;Immediately after the idea came up, he approached Nike\'s development department. Realizing the potential of the technology, Nike tried it out with its own shoe, Nike Tailwind, and in 1978. This product had an air cushion inside. However, this air cushion is completely hidden in the shoe.&lt;/p&gt;\r\n\r\n&lt;p&gt;This product did not get much success after its inception and was quickly forgotten. See also: Top 7 of the best shoe cushion technologies by Nike&lt;/p&gt;\r\n', '&lt;p&gt;Frank Rudy l√† ng∆∞·ªùi ƒë·∫ßu ti√™n c√≥ √Ω t∆∞·ªüng ƒë·∫∑t ƒë·ªám kh√≠ v√†o m·ªôt chi·∫øc gi√†y. Ngu·ªìn c·∫£m h·ª©ng c·ªßa anh ƒë·∫øn t·ª´ nh·ªØng thi·∫øt k·∫ø b·ªô ƒë√™m c·ªßa t√†u v≈© tr·ª• t·∫°i NASA - n∆°i anh l√†m vi·ªác h·∫±ng ng√†y.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ngay sau khi n·∫£y ra √Ω t∆∞·ªüng n√†y, anh l·∫≠p t·ª©c ti·∫øp c·∫≠n v·ªõi b·ªô ph·∫≠n ph√°t tri·ªÉn c·ªßa Nike. Nh·∫≠n th·∫•y ti·ªÅm nƒÉng c·ªßa c√¥ng ngh·ªá, Nike ƒë√£ th·ª≠ √°p d·ª•ng th·ª≠ v·ªõi s·∫£n ph·∫©m gi√†y c·ªßa m√¨nh l√† Nike¬†Tailwind v√† nƒÉm 1978.&lt;/p&gt;\r\n\r\n&lt;p&gt;S·∫£n ph·∫©m n√†y c√≥ ƒë·ªám kh√≠ ·ªü b√™n trong. Tuy nhi√™n, l·ªõp ƒë·ªám kh√≠ n√†y l·∫°i ·∫©n ho√†n to√†n trong gi√†y. Sau khi ra ƒë·ªùi, s·∫£n ph·∫©m n√†y kh√¥ng nh·∫≠n ƒë∆∞·ª£c nhi·ªÅu s·ª± th√†nh c√¥ng cho l·∫Øm do ƒë√≥ nhanh ch√≥ng b·ªã l√£ng qu√™n.&lt;/p&gt;\r\n\r\n&lt;p&gt;Xem th√™m:¬†&lt;a href=&quot;https://thethao247.vn/318-top-7-cong-nghe-dem-giay-ti-do-cua-nike-d177270.html&quot; rel=&quot;dofollow&quot; target=&quot;_blank&quot;&gt;Top 7 c√¥ng ngh·ªá ƒë·ªám gi√†y t·ªët nh·∫•t c·ªßa Nike&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1987, Nike Air Max 1, ƒë√¥i gi√†y Air Max ƒë·∫ßu ti√™n ra ƒë·ªùi&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a data-at-1366=&quot;https://media.thethao247.vn/origin_1366x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-1920=&quot;https://media.thethao247.vn/origin_1920x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-450=&quot;https://media.thethao247.vn/origin_450x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-800=&quot;https://media.thethao247.vn/origin_800x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-caption=&quot;&quot; href=&quot;https://media.thethao247.vn/origin_850x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot;&gt;&lt;img alt=&quot;&quot; data-ll-status=&quot;loading&quot; src=&quot;https://media.thethao247.vn/origin_850x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; title=&quot;&quot; /&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nike Air Max 1¬†(·∫£nh:¬†sneakerfreaker.com)&lt;/p&gt;\r\n\r\n&lt;p&gt;Tinker Hatfield - nh√† thi·∫øt k·∫ø ch√≠nh c·ªßa Nike, ƒë∆∞·ª£c coi l√† cha ƒë·∫ª c·ªßa¬†Air Max¬†v√† l√† ng∆∞·ªùi ƒë∆∞a nh·ªØng b·ªô ƒë·ªám n√†y tr·ªü n√™n c√≥ th·ªÉ nh√¨n th·∫•y ƒë∆∞·ª£c.&lt;/p&gt;\r\n\r\n&lt;p&gt;√îng n·∫£y ra √Ω t∆∞·ªüng ƒë∆∞a l·ªõp ƒë·ªám Air c√≥ th·ªÉ nh√¨n th·∫•y ƒë∆∞·ª£c quan s√°t nh·ªØng l·ªõp k√≠nh c·ªßa¬†Trung t√¢m tri·ªÉn l√£m¬†Pompidou Centre¬†t·∫°i Paris. Ng√†y sau khi tr·ªü v·ªÅ M·ªπ √¥ng b·∫Øt tay v√†o thi·∫øt k·∫ø b·ªô ƒë·ªám v·ªõi c√†ng nhi·ªÅu kh√¥ng kh√≠ c√†ng t·ªët. T·ª´ ƒë√¢y, thu·∫≠t ng·ªØ &quot;kh√¥ng kh√≠ t·ªëi ƒëa&quot; Maximum Air ƒë∆∞·ª£c g·ªçi t·∫Øt l√† Air Max ra ƒë·ªùi.&lt;/p&gt;\r\n\r\n&lt;p&gt;NƒÉm 1987, s·∫£n ph·∫©m Nike Air Max 1 ra ƒë·ªùi. V·ªõi b·ªô ƒë·ªám kh√≠ c√≥ th·ªÉ nh√¨n th·∫•y ·ªü ƒë·∫ø gi√†y. Ngay l·∫≠p t·ª©c ƒë√¥i gi√†y ƒëem l·∫°i s·ª± ch√∫ √Ω c·ªßa th·ªã tr∆∞·ªùng v√† b√°n r·∫•t ch·∫°y.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong nh·ªØng nƒÉm sau ƒë√≥, Nike ti·∫øp t·ª•c n·ªó l·ª