(10, 0, 0, 0, 0, '', '', 'thanh-toan-bang-chuyen-khoan', 'payment-by-bank-transfer', '', '', '- If the delivery place is suburban, suburban or inner city of Hanoi but different from the payment place (in case you send gifts, send goods to friends, partners ...) we will collect money 100% of the order value in advance + shipping fee calculated in the shipping policy by bank transfer method before shipment', '- N·∫øu ƒë·ªãa ƒëi·ªÉm giao h√†ng l√† ngo·∫°i th√†nh, ngo·∫°i t·ªânh ho·∫∑c n·ªôi th√†nh th√†nh ph·ªë H√† N·ªôi nh∆∞ng kh√°c v·ªõi ƒë·ªãa ƒëi·ªÉm thanh to√°n (trong tr∆∞·ªùng h·ª£p Qu√Ω kh√°ch g·ª≠i qu√†, g·ª≠i h√†ng cho b·∫°n b√®, ƒë·ªëi t√°c ‚Ä¶) ch√∫ng t√¥i s·∫Ω thu ti·ªÅn tr∆∞·ªõc 100% gi√° tr·ªã ƒë∆°n h√†ng + ph√≠ v·∫≠n chuy·ªÉn theo c∆∞·ªõc ph√≠ t√≠nh trong chinh s√°ch v·∫≠n chuy·ªÉn b·∫±ng ph∆∞∆°ng th·ª©c chuy·ªÉn kho·∫£n tr∆∞·ªõc khi giao h√†ng', 'Payment by bank transfer', 'Thanh to√°n b·∫±ng chuy·ªÉn kho·∫£n', 2, 'hienthi', 'hinh-thuc-thanh-toan', 1609287971, 1609287996, 0),
(11, 0, 0, 0, 0, '', '', 'thanh-toan-tai-diem-giao-hang', 'payment-at-the-point-of-delivery', '', '', '- You pay the forwarder for the whole or the rest of the purchased order value (if deposited).\r\n- This form of payment is only made for orders with a delivery address in Hanoi city (within a radius of 30 km from the place of purchase).\r\n- If the place of delivery is right at the place of payment, our delivery staff will collect the money upon delivery.', '- Qu√Ω kh√°ch thanh to√°n cho nh√¢n vi√™n giao nh·∫≠n to√†n b·ªô ho·∫∑c ph·∫ßn c√≤n l·∫°i c·ªßa gi√° tr·ªã ƒë∆°n h√†ng ƒë√£ mua (n·∫øu ƒë√£ ƒë·∫∑t c·ªçc)\r\n- H√¨nh th·ª©c thanh to√°n n√†y ch·ªâ th·ª±c hi·ªán v·ªõi c√°c ƒë∆°n h√†ng c√≥ ƒë·ªãa ch·ªâ giao h√†ng t·∫°i n·ªôi th√†nh th√†nh ph·ªë H√† N·ªôi (trong ph·∫°m vi b√°n k√≠nh 30 km t√≠nh t·ª´ n∆°i mua h√†ng).\r\n- N·∫øu ƒë·ªãa ƒëi·ªÉm giao h√†ng ngay t·∫°i n∆°i thanh to√°n, nh√¢n vi√™n giao h√†ng c·ªßa ch√∫ng t√¥i s·∫Ω thu ti·ªÅn khi giao h√†ng.', 'Payment at the point of delivery', 'Thanh to√°n t·∫°i ƒëi·ªÉm giao h√†ng', 3, 'hienthi', 'hinh-thuc-thanh-toan', 1609288000, 1609288028, 0);
